window.bookSummaryJSON = "<p>In <i>Primary Command</i> (The Forging of Luke Stone - book number two), a ground-breaking action thriller by number one bestseller Jack Mars, elite delta force veteran Luke Stone, 29, leads the FBI’s special response team on a nail-biting mission to save American hostages from a nuclear submarine. But when all goes wrong, and when the President shocks the world with his reaction, it may fall on Luke’s shoulders to save not only the hostages - but the world.<br> </p> <p><i>Primary Command</i> is an un-putdownable military thriller, a wild action ride that will leave you listening late into the night. The precursor to the number one bestselling Luke Stone Thriller Series, this series takes us back to how it all began, a riveting series by bestseller Jack Mars, dubbed “one of the best thriller authors” out there.</p> <p>Book number three - <i>Primary Threat </i>- is also available for pre-order!<br> </p> <p>Also available is Jack Mars’ number one bestselling Luke Stone Thriller series (seven books), which begins with <i>Any Means Necessary </i>(book number one)!</p>"; 
